$this->addSql("INSERT INTO employee_job_info 
                (employee_id, contract_type, job_title, general_management, department, division, div, class, grade, job_start_date, job_end_date)
            SELECT
                 employee_basic_info.id

                , CASE CAST(att_emp.contract_id  AS INTEGER)
                    WHEN 1 THEN 3
                    WHEN 2 THEN 1
                    WHEN 3 THEN 2 
                    WHEN 4 THEN 4
                    WHEN 5 THEN 5
                    WHEN 6 THEN 6
                    WHEN 7 THEN 7    
                    WHEN 8 THEN 8               
                    ELSE  0
                END contract_type
      
                , jobs.id
                , CASE (SELECT chart.dept_type FROM att_org_chart chart WHERE att_org_chart.parent_id = chart.NODE_ID)
                    WHEN  1  THEN  att_org_chart.parent_id
                    WHEN  2  THEN  att_org_chart.parent_id
                    WHEN  3  THEN  att_org_chart.parent_id
                    WHEN  4  THEN  att_org_chart.parent_id
                    ELSE  0
                  END GD

                , CASE (SELECT chart.dept_type FROM att_org_chart chart WHERE att_org_chart.parent_id = chart.NODE_ID)
                    WHEN  5  THEN  att_org_chart.parent_id
                    ELSE  0
                  END DEPT

                , CASE (SELECT chart.dept_type FROM att_org_chart chart WHERE att_org_chart.parent_id = chart.NODE_ID)
                    WHEN  6  THEN  att_org_chart.parent_id
                    ELSE  0
                  END SEC

                , CASE (SELECT chart.dept_type FROM att_org_chart chart WHERE att_org_chart.parent_id = chart.NODE_ID)
                    WHEN  7  THEN  att_org_chart.parent_id
                    ELSE  0
                  END DIV

                , 0
                , 0                
                , att_org_emp_node.active_date
                , NULL
              FROM
                  employee_basic_info
                , att_org_chart
                , att_org_emp_node
                , jobs
                , att_emp

              WHERE
                CAST(att_org_emp_node.emp_id AS INTEGER) = employee_basic_info.employee_no
              AND
                CAST(att_emp.emp_id AS INTEGER) = employee_basic_info.employee_no
              AND  
                att_org_emp_node.active = 'Y'
              AND
                jobs.org_job = CONCAT(att_org_chart.dept_type,att_org_chart.dept_value)
              AND
                CAST(att_org_emp_node.node_id AS INTEGER) = att_org_chart.node_id
           
             ");

            $this->addSql("UPDATE employee_job_info 
                          SET   division = 
                              (SELECT DISTINCT parent_id 
                                FROM  att_org_chart  , employee_job_info job
                                WHERE job.div = att_org_chart.NODE_ID
                                AND   job.div  = employee_job_info.div
                                AND   job.division = 0
                                AND   job.div != 0 )
                          WHERE division = 0
                          AND   div != 0 
                    ");                            


               
          $this->addSql("UPDATE employee_job_info 
                        SET   department = 
                            (SELECT DISTINCT parent_id 
                              FROM  att_org_chart  , employee_job_info job
                              WHERE job.division = att_org_chart.NODE_ID
                              AND   job.division  = employee_job_info.division
                              AND   job.department = 0
                              AND   job.division != 0 )
                        WHERE department = 0
                        AND   division != 0 
                      ");


            $this->addSql("UPDATE employee_job_info 
                            SET   general_management = 
                                (SELECT DISTINCT parent_id 
                                  FROM  att_org_chart  , employee_job_info job
                                  WHERE job.department = att_org_chart.NODE_ID
                                  AND   job.department  = employee_job_info.department
                                  AND   job.general_management = 0
                                  AND   job.department != 0 )
                            WHERE general_management = 0
                            AND   department != 0 
            ");

    


    $this->addSql(" INSERT INTO employee_os (employee_id,os_id,role_id,start_date) 
                    SELECT employee_id,
                        CASE 
                        WHEN (div != 0) THEN div
                        WHEN (division != 0 AND div = 0) THEN division
                        WHEN (department != 0 AND division = 0 AND div = 0) THEN department
                        WHEN (general_management != 0 AND department = 0 AND division = 0 AND div = 0) THEN general_management
                        END ,
                        1,'2000/01/01'
                    FROM employee_job_info
                    WHERE employee_id != 1 
                    AND NOT (general_management = 0 AND department = 0 AND division = 0 AND div = 0)
                  ");

